import axios from "axios";
import { SignInRequestDto,SignUpRequestDto } from "./Request/Auth";

import { ResponseDto } from "./Response";
import { SignInResponseDto, SignUpResponseDto } from "./Response/Auth";
import { GetSignInUserResponseDto } from "./Response/User";
import { PatchBoardRequestDto, PostBoardRequestDto, PostCommentRequestDto } from "./Request/Board";
import { PostBoardResponseDto,GetBoardResponseDto, IncreaseViewCountResponseDto, GetFavoriteListResponseDto, GetCommentListResponseDto, PutFavoriteResponseDto, PostCommentResponseDto, DeleteBoardResponseDto, PatchBoardResponseDto, GetLatestBoardListResponseDto, GetTop3BoardListResponseDto } from "./Response/Board";
import { GetPopularListResponseDto } from "./Response/Search";



const DOMAIN ='http://localhost:8080';


const API_DOMAIN =`${DOMAIN}/api/v1`;

const authorization =(accessToken:string)=>{
    return{headers:{Authorization:`Bearer ${accessToken}`}}
};
const SIGIN_IN_URL =()=>`${API_DOMAIN}/auth/sign-in`;
const SIGIN_UP_URL =()=>`${API_DOMAIN}/auth/sign-up`;

export const SignInRequest=async(requestBody:SignInRequestDto)=>{
    const result =await axios.post(SIGIN_IN_URL(),requestBody)
    .then(response=>{
        const responseBody:SignInResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response.data) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}   

export const SignUpRequest=async(requestBody:SignUpRequestDto)=>{

    const result =await axios.post(SIGIN_UP_URL(),requestBody)
    .then(response=>{
        const responseBody:SignUpResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response.data) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;


    });


    return result;
}

const GET_BOARD_URL =(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}`;
const GET_LATEST_BOARD_LIST_URL=()=>`${API_DOMAIN}/board/latest-list`;
const GET_TOP_3_BOARD_LIST_URL=()=>`${API_DOMAIN}/board/top-3`;
const GET_SEARCH_BOARD_LIST_URL=(searchWord)
const INCREASE_VIEW_COUNT_URL =(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}/increase-view-count`;
const GET_FAVORITE_LIST_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}/favorite-list`;
const GET_COMMENT_LIST_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}/comment-list`;
const POST_BOARD_URL =()=>`${API_DOMAIN}/board`;
const POST_COMMENT_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}/comment`;
const PATCH_BOARD_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}`;
const PUT_FAVORITE_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}/favorite`;
const DELETE_BOARD_URL=(boardNumber:number |string)=>`${API_DOMAIN}/board/${boardNumber}`;



export const getBoardRequest =async(boardNumber:number |string)=>{

    const result =await axios.get(GET_BOARD_URL(boardNumber))
    .then(response=>{

        const responseBody:GetBoardResponseDto =response.data
        return responseBody;

    })
    .catch(error=>{

        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;

    })

    return result;
}

export const getLatestBoardListRequest=async ()=>{
    const result=await axios.get(GET_LATEST_BOARD_LIST_URL())
    .then(response =>{
        const responseBody: GetLatestBoardListResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response)return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;

    });
    return result;
}

export const getTop3BoardListRequest=async ()=>{
    const result=await axios.get(GET_TOP_3_BOARD_LIST_URL())
    .then(response =>{
        const responseBody: GetTop3BoardListResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response)return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;

    });
    return result;
}



export const increaseViewCountRequset = async(boardNumber:number |string)=>{
    const result= await axios.get(INCREASE_VIEW_COUNT_URL(boardNumber))
    .then(response=>{

        const responseBody: IncreaseViewCountResponseDto=response.data;
        return responseBody;


    })
    .catch(error=>{
        if(!error.response)return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;


    })

    return result;
}


export const getFavoriteListRequest= async (boardNumber:number |string)=>{
    const result =await axios.get(GET_FAVORITE_LIST_URL(boardNumber)) 
    .then(response=>{
        const responseBody:GetFavoriteListResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
            if(!error.response) return null;
            const responseBody:ResponseDto =error.response.data;
            return responseBody;
    });
    return result;
}

export const getCommentListRequest =async (boardNumber:number |string)=>{
    const result =await axios.get(GET_COMMENT_LIST_URL(boardNumber))
    .then(response=>{

        const responseBody:GetCommentListResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
            const responseBody:ResponseDto =error.response.data;
            return responseBody;
    })

    return result;


}

export const postBoardReqest = async(requestBody:PostBoardRequestDto,accessToken:string)=>{
    const result =await axios.post(POST_BOARD_URL(),requestBody,authorization(accessToken))
    .then(response=>{
        const responseBody:PostBoardResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}

export const postCommentRequest=async(boardNumber:number |string,requestBody:PostCommentRequestDto,accessToken:string)=>{
    const result =await axios.post(POST_COMMENT_URL(boardNumber),requestBody,authorization(accessToken))
    .then(response=>{
        const responseBody:PostCommentResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}


export const patchBoardRequest =async(boardNumber:number|string,requestBody:PatchBoardRequestDto,accessToken:string)=>{
    const result= await axios.patch(PATCH_BOARD_URL(boardNumber),requestBody,authorization(accessToken))
    .then(response=>{

        const responseBody:PatchBoardResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })

    return result;


}






export const putFaoriteRequest= async(boardNumber:number |string,accessToken:string)=>{
    const result =await axios.put(PUT_FAVORITE_URL(boardNumber),{},authorization(accessToken))
    .then(response=>{
        const responseBody:PutFavoriteResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}

export const deleteBoardRequest =async(boardNumber:number |string,accessToken:string)=>{
    const result =await axios.delete(DELETE_BOARD_URL(boardNumber),authorization(accessToken))
    .then(response=>{
        const responseBody:DeleteBoardResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}

const GET_POPULAR_LIST_URL=()=>`${API_DOMAIN}/search/popular-list`;
export const getPopularListRequest= async()=>{
    const result =await axios.get(GET_POPULAR_LIST_URL())
    .then(response=>{
        const responseBody:GetPopularListResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}



const GET_SIGN_USER_URL =()=> `${API_DOMAIN}/user`;
export const getSignInUserRequest= async(accessToken:string)=>{
    const result =await axios.get(GET_SIGN_USER_URL(),authorization(accessToken))
    .then(response=>{
        const responseBody:GetSignInUserResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    });
    return result;

}

const FILE_DOMAIN =`${DOMAIN}/file`;

const FILE_UPLOAD_URL=()=>`${FILE_DOMAIN}/upload`;

const multipartFormData={headers:{'Content-Type':'multipart/form-data'}}

export const fileUploadRequest= async(data: FormData)=>{
    const result= await axios.post(FILE_UPLOAD_URL(),data,multipartFormData)
    .then(response=>{
        const responsBody:string=response.data;
        return responsBody;
    })
    .catch(error=>{
        return null;
    })
    return result;
}
